import React, { useEffect } from "react";
import { useNavigate } from 'react-router-dom'


function Home() {

  const navigate = useNavigate()

  useEffect(() => {
    const dataRegister = JSON.parse(localStorage.getItem("dataRegister"))
    if (!dataRegister) {
      navigate('register')
    }
  }, [])

  return <div>Home</div>
}

export default Home;
